import { useState, useEffect } from 'react';
import Blogs from './components/Blogs';

const App = () => {

  const [blogs, setBlogs] = useState([
    { name: 'Arto Hellas' }
  ])

  const blogit = blogs.map(blog => {
    <p>{blog.title}</p>
  })

  return (
    <div className="App">
      <h1>Blogs</h1>
      <p>{blogit}</p>
      <Blogs />
    </div>
  );
}

export default App
